import React from 'react';
import { useNavigate } from 'react-router-dom';
import { Search } from 'lucide-react';

function UserHome() {
  const navigate = useNavigate();

  const handleLogout = () => {
    // Perform any necessary logout operations here
    alert("Logged out successfully");
    navigate("/");
  };

  return (
    <div className="flex flex-col items-center justify-center h-screen">
      <div className="bg-white rounded-lg shadow-md w-full max-w-3xl p-8">
        <h1 className="text-4xl font-bold mb-4">Welcome to the Educational Resource Library</h1>
        <p className="text-lg text-gray-600 mb-8">
          Explore a vast collection of educational materials, including textbooks, research papers, and study guides.
        </p>
        <div className="relative mb-8">
          <div className="absolute inset-y-0 left-0 flex items-center pl-3 pointer-events-none">
            <Search className="w-5 h-5 text-gray-400" />
          </div>
          <input
            type="text"
            className="w-full px-4 py-2 pl-10 text-gray-900 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-blue-500"
            placeholder="Search the library..."
          />
        </div>
        <button
          onClick={handleLogout}
          className="px-4 py-2 text-white bg-blue-500 rounded-md hover:bg-blue-600 focus:outline-none focus:ring-2 focus:ring-blue-500 focus:ring-opacity-50"
        >
          Logout
        </button>
      </div>
    </div>
  );
}

export default UserHome;
